window.bookSummaryJSON = "<p>In his Alpine base, Blofeld is developing biological weapons that will devastate Britain. Unaware of the danger, James Bond is about to marry Teresa di Vicenzo, the daughter of a Corsican Mafioso. But then he is sent to Switzerland. Bond's marriage and Blofeld's schemes disintegrate in a blizzard of gunfire and high-explosives from which neither man emerges the victor. </p> <p>This audiobook includes an exclusive bonus interview with David Tennant.</p> <p>Blackstone Audio, Inc. James Bond and 007 are registered trademarks of Danjaq LLC, used under license by Ian Fleming Publications Ltd</p>"; 
